(7, 'Addition', NULL, 1000, 32768, 'Standard Input', 'Standard Output', '<p>You have to add two numbers and display the result</p>', '<p>two integers, x and y.</p>', '<p>the summation of x and y.</p>', '3 2', '5\r\n', NULL, '2015-12-09 23:21:11', '20 10', '30\r\n', 0, '<p>Remember that the summation of two integers can be larger than the limit of integer.</p>', 'Open Judge', 0, 0),
