(9, 'Area of a circle', NULL, 1000, 32768, 'Standard Input', 'Standard Output', '<p>You''ll be given the radius of a circle. You have to calculate the area of that circle. Assume PI = 3.1416</p>', '<p>A positive floating point number r</p>', '<p>The area of the circle having radius of r. Output should be matched up to 2 digits after decimal points</p>', '10.0', '314.16\r\n', NULL, '2015-12-09 23:26:11', '531.2176', '886534.82\r\n', 0, '<p>Make sure floating point rounding to avoid wrong answer.</p>', 'Open Judge', 0, 0),
(11, 'Hello World :D', NULL, 1000, 512, 'Standard Input', 'Standard Output', '<p>Just print "Hello World" n times, without the quotes, in n lines.</p>', '<p>Each line of the input contains an integer <strong>n (1&lt;= n &lt;=10).</strong></p>', '<p>Just print "Hello World" n times, without the quotes, in n lines for each test case. Output a single blank line between two test cases.</p>', '2\r\n3', 'Hello World\r\nHello World\r\n\r\nHello World\r\nHello World\r\nHello World\r\n', NULL, '2015-12-29 17:51:35', '5\r\n10', 'Hello World\r\nHello World\r\nHello World\r\nHello World\r\nHello World\r\n\r\nHello World\r\nHello World\r\nHello World\r\nHello World\r\nHello World\r\nHello World\r\nHello World\r\nHello World\r\nHello World\r\nHello World\r\n', 0, '<p>No hint, sorry :/</p>', 'Md. Al-Amin Opu', 0, 0),
(12, 'Forward >> | << Backward', NULL, 1000, 262144, 'Standard Input', 'Standard Output', '<p>FunnyBunny, name of a popular duck discovered recently in an unknown area of this planet. Everyone loves her not only because she is super cute, lovely and adorable; but also for her own specialized technique to move towards a direction.</p>\r\n<p>The movement technique of FunnyBunny is following:<br /> If she move on the 1<sup>st</sup> step, she goes double the i<sup>th</sup> unit forward and i<sup>th</sup> unit backward. And she continuous the movement. For example, on the 1<sup>st</sup> step she goes 2 unit forward and 1 unit backward. On the 2<sup>nd</sup> step, she goes 4 unit forward and 2 unit backward and continuous going on.</p>\r\n<p>Your job is to find how far FunnyBunny can go in S steps.</p>', '<p>T (&lt;=50), number of test cases and S (&lt;=10000000), number of steps FunnyBunny will take.</p>', '<p>For each case, print the following format &ldquo;Case X: R&rdquo;, where X is the case number and R is the result, how far FunnyBunny can go.</p>', '5\r\n16', 'Case 1: 15\r\nCase 2: 136', '3e9a64fe4447dfcad50ac61c7a232500.png', '2015-12-29 20:01:58', '10000000\r\n5\r\n10000000\r\n10000000\r\n16\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n', 'Case 1: 50000005000000\r\nCase 2: 15\r\nCase 3: 50000005000000\r\nCase 4: 50000005000000\r\nCase 5: 136\r\nCase 6: 50000005000000\r\nCase 7: 50000005000000\r\nCase 8: 50000005000000\r\nCase 9: 50000005000000\r\nCase 10: 50000005000000\r\nCase 11: 50000005000000\r\nCase 12: 50000005000000\r\nCase 13: 50000005000000\r\nCase 14: 50000005000000\r\nCase 15: 50000005000000\r\nCase 16: 50000005000000\r\nCase 17: 50000005000000\r\nCase 18: 50000005000000\r\nCase 19: 50000005000000\r\nCase 20: 50000005000000\r\nCase 21: 50000005000000\r\nCase 22: 50000005000000\r\nCase 23: 50000005000000\r\nCase 24: 50000005000000\r\nCase 25: 50000005000000\r\nCase 26: 50000005000000\r\nCase 27: 50000005000000\r\nCase 28: 50000005000000\r\nCase 29: 50000005000000\r\nCase 30: 50000005000000\r\nCase 31: 50000005000000\r\nCase 32: 50000005000000\r\nCase 33: 50000005000000\r\nCase 34: 50000005000000\r\nCase 35: 50000005000000\r\nCase 36: 50000005000000\r\nCase 37: 50000005000000\r\nCase 38: 50000005000000\r\nCase 39: 50000005000000\r\nCase 40: 50000005000000\r\nCase 41: 50000005000000\r\nCase 42: 50000005000000\r\nCase 43: 50000005000000\r\nCase 44: 50000005000000\r\nCase 45: 50000005000000\r\nCase 46: 50000005000000\r\nCase 47: 50000005000000\r\nCase 48: 50000005000000\r\nCase 49: 50000005000000\r\nCase 50: 50000005000000\r\n', 0, '<p>Just use your imagination!</p>', 'Anis', 0, 0),
(13, 'Friday', NULL, 1000, 524288, 'Standard Input', 'Standard Output', '<p>John is a computer engineer. He loves to write code. He also belives in numbers.&nbsp; Everything in his life, he wants to decide based on number. <br /><br />He completed his graduation&nbsp; from a reputed University on last month.&nbsp; Yesterday, He got a job offer from Google.&nbsp; They asked him to join their company in 2017, because this year they don''t have enough fund to hire a fresh graduate ;) . Now John needs to decide either he take the offer or not.&nbsp; He is busy with some other tasks, So he needs your help. &nbsp;<br /><br />Can you help him to find the number of Fridays in the month of February 2017?&nbsp; He will join Google if the number is even.</p>', '<p>Hurray!! There is no input for this problem.&nbsp;</p>', '<p>Print " <strong>Yes</strong> " if he join in Google or print " <strong>No</strong> " if he doesn''t (without the quotes).</p>', 'No Sample Input', 'No Sample Output', NULL, '2015-12-30 11:24:42', '', 'Yes\r\n', 0, '', 'Md. Al-Amin Opu', 0, 0),
(14, 'Thesis Notebook', NULL, 1000, 524288, 'Standard Input', 'Standard Output', '<p>I am very busy with my thesis work. It is almost finished. I already calculated all the resulted data.I am not so updated with the modern era. So I have no any soft copy. I stored all the calculation and result into my notebook. <br /><br />I put my notebook on the bookshelf. After some days I keep my notebook and saw something disappointing after opening this. Some insects cut my notebook and some datas are lost. So I worried about finishing my thesis work. I am not good at mathematics. I have no knowledge about programming. How can I recover these data? I disappointed and thought that my thesis never be finished. <br /><br />yes!!!!!!!! . I got an idea. I have a friend named Opu. He is a good programmer. I know, a good programmer should be a good mathematician obviously. So I asked for help to him. He asked me about my missing data. It was five integer numbers A,B,C,D,E written into my notebook. But one of them is lost. I have also L the LCM ( least common multiple) of these numbers written in the other page. That means I have four numbers of A,B,C,D,E and the LCM(A,B,C,D,E)and the missing one should be recovered. <br /><br />Hearing this Opu told me, &ldquo;Don&rsquo;t worry friend, It&rsquo;s a very easy task. My juniors even can do this.&rdquo;<br />So he sent me to you. Please find me the missing one.</p>', '<p style="margin-bottom: 0in; line-height: 138%;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;"><span style="font-variant: normal;"><span style="text-decoration: none;"><span style="font-style: normal;"><span style="font-weight: normal;"><span style="background: #ffffff;">Input starts with an integer </span></span></span></span></span><span style="font-variant: normal;"><span style="text-decoration: none;"><span style="font-style: normal;"><strong><span style="background: #ffffff;">T (&le; 300)</span></strong></span></span></span><span style="font-variant: normal;"><span style="text-decoration: none;"><span style="font-style: normal;"><span style="font-weight: normal;"><span style="background: #ffffff;">, denoting the number of test cases.</span></span></span></span></span></span></span></span></p>\r\n<p style="margin-bottom: 0in; font-variant: normal; font-style: normal; font-weight: normal; line-height: 138%; text-decoration: none;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;"><span style="background: #ffffff;">Next T lines as follows, </span></span></span></span></p>\r\n<p style="margin-bottom: 0in; line-height: 138%;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;"><span style="font-variant: normal;"><span style="text-decoration: none;"><span style="font-style: normal;"><span style="font-weight: normal;"><span style="background: #ffffff;">F</span></span></span></span></span><span style="font-variant: normal;"><span style="text-decoration: none;"><span style="font-style: normal;"><span style="font-weight: normal;"><span style="background: #ffffff;">our integer of A,B,C,D,E and L. (1 &le; integers &le; 5*10</span></span></span></span></span><span style="font-variant: normal;"><span style="text-decoration: none;"><sup><span style="font-style: normal;"><span style="font-weight: normal;"><span style="background: #ffffff;">6</span></span></span></sup></span></span><span style="font-variant: normal;"><span style="text-decoration: none;"><span style="font-style: normal;"><span style="font-weight: normal;"><span style="background: #ffffff;">, 1 &le; L &le; 10</span></span></span></span></span><span style="font-variant: normal;"><span style="text-decoration: none;"><sup><span style="font-style: normal;"><span style="font-weight: normal;"><span style="background: #ffffff;">12</span></span></span></sup></span></span><span style="font-variant: normal;"><span style="text-decoration: none;"><span style="font-style: normal;"><span style="font-weight: normal;"><span style="background: #ffffff;">)</span></span></span></span></span></span></span></span></p>\r\n<p style="margin-bottom: 0in; font-variant: normal; font-style: normal; font-weight: normal; line-height: 138%; text-decoration: none;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;"><span style="background: #ffffff;">You may safely assume that the LCM of four numbers is less than 10<sup>12</sup>. </span></span></span></span></p>', '<p style="margin-bottom: 0in; line-height: 138%;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;"><span style="font-variant: normal;"><span style="text-decoration: none;"><span style="font-style: normal;"><span style="font-weight: normal;"><span style="background: transparent;">Print the case number and an integer( The missing integer). there can be several answer, you should find the smallest one. </span></span></span></span></span><span style="font-variant: normal;"><span style="text-decoration: none;"><span style="font-style: normal;"><span style="font-weight: normal;"><span style="background: #ffffff;">If no solution is found, print </span></span></span></span></span><span style="font-variant: normal;"><span style="text-decoration: none;"><span style="font-style: normal;"><strong><span style="background: #ffffff;">''impossible''</span></strong></span></span></span><span style="font-variant: normal;"><span style="text-decoration: none;"><span style="font-style: normal;"><span style="font-weight: normal;"><span style="background: #ffffff;">.</span></span></span></span></span></span></span></span></p>\r\n<p style="margin-bottom: 0in;" align="justify">&nbsp;</p>', '3\r\n2  3  5  7  2310\r\n2  2  2  2  10\r\n5  4  8  5  20', 'Case 1: 11\r\nCase 2: 5\r\nCase 3: impossible\r\n', NULL, '2015-12-30 11:32:01', '45\r\n2 3 5 7 2310\r\n2 2 2 2 10\r\n2 5 10 1 20\r\n1000000 1000000 1000000 1000000 1000000000000\r\n3542 235 2325  325  2353455\r\n10 20 30 40 240\r\n1000000 1000000 1000000 1000000 600000000\r\n1000000 1000000 1000000 1000000 700000000\r\n1 995909 995927 1  534564634645\r\n1000000 2000000 1000000 4000000 800000000000\r\n1000000 2000000 1000000 4000000 900000000000\r\n2 4 6 8 240000192\r\n100 5 6 3 900\r\n4 400 100  49 47059600\r\n1000000 1000000 1000000 1000000 2000000\r\n5 3 3 5 30\r\n124123 235 345 315 232523523\r\n5 7 5 7 35\r\n1000000 1000000 1000000 1000000 3000000\r\n999983 999971 2352 23523  1\r\n6 3 5 1 900\r\n999983 1 999979 1  21423423\r\n1000000 1000000 1000000 1000000 3000000\r\n19 1 38 2  656877174796\r\n88 44 11 61 808508427232\r\n1000000 1000000 1000000 1000000 70000000000\r\n7699 7919 529 1 129009094\r\n1000000 1000000 1000000 1000000 100000000000\r\n7970 10 5 435579 670011973590\r\n182540 100 50 877100 928613837200\r\n3 235 235235 235532 2352235\r\n1000000 1000000 1000000 1000000 5000000\r\n349927 2 349931 2 734701830222\r\n919440 4  547404 40 545247228240\r\n3 1 5 5 200560490130\r\n5  4  8  5  20\r\n3000000 2000000 5000000 600000  900000000000\r\n4000 60000 70000 29000  1200000000\r\n5 6 7 9  771750  \r\n145399 145133 2 3 253226316804\r\n999623 1  999961 1 35235345636\r\n97 13 2522 279942  268730449\r\n1000000 2000000 1000000 4000000 110000000000\r\n97 13 2522 279942  4589089206\r\n7699 7919 529 1 129009094196\r\n', 'Case 1: 11\r\nCase 2: 5\r\nCase 3: 4\r\nCase 4: 1000000000000\r\nCase 5: impossible\r\nCase 6: 16\r\nCase 7: 600000000\r\nCase 8: 700000000\r\nCase 9: impossible\r\nCase 10: 800000000000\r\nCase 11: 900000000000\r\nCase 12: 240000192\r\nCase 13: 9\r\nCase 14: 117649\r\nCase 15: 128\r\nCase 16: 2\r\nCase 17: impossible\r\nCase 18: 1\r\nCase 19: 3\r\nCase 20: impossible\r\nCase 21: 900\r\nCase 22: impossible\r\nCase 23: 3\r\nCase 24: 34572482884\r\nCase 25: 1204930592\r\nCase 26: 70000000000\r\nCase 27: impossible\r\nCase 28: 100000000000\r\nCase 29: 193\r\nCase 30: 464\r\nCase 31: impossible\r\nCase 32: 78125\r\nCase 33: 3\r\nCase 34: 169\r\nCase 35: 13370699342\r\nCase 36: impossible\r\nCase 37: 900000000000\r\nCase 38: impossible\r\nCase 39: 42875\r\nCase 40: 4\r\nCase 41: impossible\r\nCase 42: impossible\r\nCase 43: 110000000000\r\nCase 44: 20671573\r\nCase 45: 4\r\n', 0, '', 'Md. Shakhawat Hossain', 0, 0);
INSERT INTO `problem` (`problem_id`, `problem_name`, `problem_level`, `problem_time_limit`, `problem_memory_limit`, `problem_input_channel`, `problem_output_channel`, `problem_description`, `problem_input`, `problem_output`, `problem_sample_input`, `problem_sample_output`, `problem_image`, `problem_add_date`, `problem_judge_input`, `problem_judge_output`, `problem_io_type`, `problem_hint`, `problem_setter`, `problem_status`, `problem_special_judge`) VALUES
(15, 'FunnyBunny', NULL, 1000, 524288, 'Standard Input', 'Standard Output', '<p style="margin-bottom: 0in;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">FunnyBunny, the name of a popular duck discovered recently in an unknown area of this planet. Everyone loves her not only because she is super cute, adorable and lovely; but also for her own specialized technique to move towards a direction. </span></span></span></p>\r\n<p style="margin-bottom: 0in;" align="justify">&nbsp;</p>\r\n<p style="margin-bottom: 0in;" align="center"><span style="color: #000000;"><img src="data:image/png;base64," alt="" width="371" height="290" name="Picture 1" align="bottom" border="0" /> </span></p>\r\n<p style="margin-bottom: 0in;" align="justify">&nbsp;</p>\r\n<p style="margin-bottom: 0in;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">The movement technique of FunnyBunny is following: If she move on the <em><strong>i</strong></em><sup><em><strong>th</strong></em></sup> step, she goes double the <em><strong>i</strong></em> unit forward and <em><strong>i</strong></em> unit backward. And she continuous the movement. For example, on the 1<sup>st</sup> step she goes 2 unit forward and 1 unit backward. On the 2<sup>nd</sup> step, she goes 4 unit forward and 2 unit backward and continuous going on. So, on the 5<sup>th</sup> step, she covered a total of 15 unit.</span></span></span></p>\r\n<p style="margin-bottom: 0in;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">IF you look closely, you can see &ldquo;F&rdquo; is for &ldquo;Forward&rdquo; as for &ldquo;Funny&rdquo;. &ldquo;B&rdquo; is for &ldquo;Backward&rdquo; as for &ldquo;Bunny&rdquo;. So, you know now, why her name is FunnyBunny. :)</span></span></span></p>\r\n<p style="margin-bottom: 0in;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">Now, your job is to find how far FunnyBunny can go in S steps.</span></span></span></p>', '<p style="margin-bottom: 0in;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">Input consists of <strong>T (&lt;=50)</strong>, number of test cases and then T lines of <strong>S (&lt;=10000000)</strong>, number of steps FunnyBunny will take.</span></span></span></p>', '<p style="margin-bottom: 0in;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">For each case, print the following format <strong>Case X: R</strong>, where <strong>X</strong> is the case number and <strong>R</strong> is the result, how far the FunnyBunny can go forward.</span></span></span></p>', '2\r\n5\r\n16', 'Case 1: 15\r\nCase 2: 136\r\n', NULL, '2015-12-30 11:33:56', '50\r\n10000000\r\n16\r\n5\r\n10000000\r\n10000000\r\n10000000\r\n30\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n10000000\r\n', 'Case 1: 50000005000000\r\nCase 2: 136\r\nCase 3: 15\r\nCase 4: 50000005000000\r\nCase 5: 50000005000000\r\nCase 6: 50000005000000\r\nCase 7: 465\r\nCase 8: 50000005000000\r\nCase 9: 50000005000000\r\nCase 10: 50000005000000\r\nCase 11: 50000005000000\r\nCase 12: 50000005000000\r\nCase 13: 50000005000000\r\nCase 14: 50000005000000\r\nCase 15: 50000005000000\r\nCase 16: 50000005000000\r\nCase 17: 50000005000000\r\nCase 18: 50000005000000\r\nCase 19: 50000005000000\r\nCase 20: 50000005000000\r\nCase 21: 50000005000000\r\nCase 22: 50000005000000\r\nCase 23: 50000005000000\r\nCase 24: 50000005000000\r\nCase 25: 50000005000000\r\nCase 26: 50000005000000\r\nCase 27: 50000005000000\r\nCase 28: 50000005000000\r\nCase 29: 50000005000000\r\nCase 30: 50000005000000\r\nCase 31: 50000005000000\r\nCase 32: 50000005000000\r\nCase 33: 50000005000000\r\nCase 34: 50000005000000\r\nCase 35: 50000005000000\r\nCase 36: 50000005000000\r\nCase 37: 50000005000000\r\nCase 38: 50000005000000\r\nCase 39: 50000005000000\r\nCase 40: 50000005000000\r\nCase 41: 50000005000000\r\nCase 42: 50000005000000\r\nCase 43: 50000005000000\r\nCase 44: 50000005000000\r\nCase 45: 50000005000000\r\nCase 46: 50000005000000\r\nCase 47: 50000005000000\r\nCase 48: 50000005000000\r\nCase 49: 50000005000000\r\nCase 50: 50000005000000\r\n', 0, '', 'Anisuzzaman Khan', 0, 0);
INSERT INTO `problem` (`problem_id`, `problem_name`, `problem_level`, `problem_time_limit`, `problem_memory_limit`, `problem_input_channel`, `problem_output_channel`, `problem_description`, `problem_input`, `problem_output`, `problem_sample_input`, `problem_sample_output`, `problem_image`, `problem_add_date`, `problem_judge_input`, `problem_judge_output`, `problem_io_type`, `problem_hint`, `problem_setter`, `problem_status`, `problem_special_judge`) VALUES
(16, 'The Shooter', NULL, 3500, 524288, 'Standard Input', 'Standard Output', '<p style="margin-top: 0.19in; margin-bottom: 0.19in; line-height: 100%;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">Here comes the shooter and it''s you!</span></span></span></p>\r\n<p style="margin-top: 0.19in; margin-bottom: 0.19in; line-height: 100%;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">You need to name your game hero "H" in string and set the number of bullets in your gun "B". Then the game starts!</span></span></span></p>\r\n<p style="margin-top: 0.19in; margin-bottom: 0.19in; line-height: 100%;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">For each bullets your hero will take a damage and cause the last character of your hero removed. If no character left then your hero died, you will have to print the shoot number when he dies. An overkill will happens if your game hero dies. That means if the number of bullets are more than the hero''s name you overkilled your game hero. Let''s see if you can beat your own made game hero or lose with him!</span></span></span></p>\r\n<p style="margin-bottom: 0in;" align="justify">&nbsp;</p>', '<p style="margin-top: 0.19in; margin-bottom: 0.19in; line-height: 100%;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">Each line of input consisting of a string for game hero H and a number of bullets B.</span></span></span></p>', '<p style="margin-bottom: 0in;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">Print&nbsp;<span style="font-family: Monaco,monospace;"><span style="font-size: small;">## Case X: ##</span></span> followed by a new line, then Shoot Y: and the corresponding result (remaining characters, &lsquo;died!&rsquo; or &lsquo;overkill!&rsquo;) for the game hero. Here X is the test case number,&nbsp;Y is the shot number. Remember to put new lines between each test cases. See sample input and output for the formatting.</span></span></span></p>\r\n<p style="margin-bottom: 0in;" align="justify">&nbsp;</p>', 'jolil 8\r\ndipjol 4\r\nmosharrof 9', '## Case 1: ##\r\nShoot 1: joli\r\nShoot 2: jol\r\nShoot 3: jo\r\nShoot 4: j\r\nShoot 5: died!\r\nShoot 6: overkill!\r\nShoot 7: overkill!\r\nShoot 8: overkill!\r\n\r\n## Case 2: ##\r\nShoot 1: dipjo\r\nShoot 2: dipj\r\nShoot 3: dip\r\nShoot 4: di\r\n\r\n## Case 3: ##\r\nShoot 1: mosharro\r', NULL, '2015-12-30 11:41:17', 'anis 10\r\nmunna 12\r\nopu 5\r\nety 1\r\nsumaiya 3\r\nzamil 5\r\n', '## Case 1: ##\r\nShoot 1: ani\r\nShoot 2: an\r\nShoot 3: a\r\nShoot 4: died!\r\nShoot 5: overkill!\r\nShoot 6: overkill!\r\nShoot 7: overkill!\r\nShoot 8: overkill!\r\nShoot 9: overkill!\r\nShoot 10: overkill!\r\n\r\n## Case 2: ##\r\nShoot 1: munn\r\nShoot 2: mun\r\nShoot 3: mu\r\nShoot 4: m\r\nShoot 5: died!\r\nShoot 6: overkill!\r\nShoot 7: overkill!\r\nShoot 8: overkill!\r\nShoot 9: overkill!\r\nShoot 10: overkill!\r\nShoot 11: overkill!\r\nShoot 12: overkill!\r\n\r\n## Case 3: ##\r\nShoot 1: op\r\nShoot 2: o\r\nShoot 3: died!\r\nShoot 4: overkill!\r\nShoot 5: overkill!\r\n\r\n## Case 4: ##\r\nShoot 1: et\r\n\r\n## Case 5: ##\r\nShoot 1: sumaiy\r\nShoot 2: sumai\r\nShoot 3: suma\r\n\r\n## Case 6: ##\r\nShoot 1: zami\r\nShoot 2: zam\r\nShoot 3: za\r\nShoot 4: z\r\nShoot 5: died!\r\n', 0, '', 'Anisuzzaman Khan', 0, 0),
(17, 'Free WiFi for Everyone', NULL, 1000, 524288, 'Standard Input', 'Standard Output', '<p style="margin-bottom: 0in; line-height: 115%;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">Who doesn''t love free WiFi? Not me, at least. I''m sure you are, too. </span></span></span></p>\r\n<p style="margin-bottom: 0in; line-height: 115%;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">Lets find out how much distance you have to move from your current position to get a ABSOLUTELY free wifi connection. Oh yes, the WiFi network name is #ONLY_HOZOR_IS_REAL, and the password is: #YOUR_MURID_IS_HERE.</span></span></span></p>', '<p style="margin-bottom: 0in; line-height: 115%;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">The first line of the input contains a single integer T (1&lt;=T&lt;=10), denoting the number of test cases.</span></span></span></p>\r\n<p style="margin-bottom: 0in; line-height: 115%;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">Each of the following T lines contains five numbers: X, Y (integers), the coordinates of the WiFi router, R (double), the distance/range that the router can cover, and MX, MY (integers), your current coordinates. </span></span></span></p>', '<p style="margin-bottom: 0in; line-height: 115%;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">For each test case, print a single line in this format: &ldquo;Case P: Q&rdquo;, where P is the case number and Q is the distance you need to move from your current position to get signal from the router. Note that Q must be rounded up to two digits after decimal point. If you are already in range, print 0.00</span></span></span></p>', '3\r\n2 2 3.50 3 5\r\n0 0 5.79 10 10\r\n11 10 9.81 6 7', 'Case 1: 0.00\r\nCase 2: 8.35\r\nCase 3: 0.00', NULL, '2015-12-30 11:43:59', '7\r\n2 2 3.50 3 5\r\n2 2 3.00 2 6\r\n0 0 5.79 10 10\r\n11 10 9.81 6 7\r\n-5 -2 0.47 -5 -3\r\n100 21 50.0 1000 1000\r\n0 0 0.0 0 0\r\n', 'Case 1: 0.00\r\nCase 2: 1.00\r\nCase 3: 8.35\r\nCase 4: 0.00\r\nCase 5: 0.53\r\nCase 6: 1279.83\r\nCase 7: 0.00\r\n', 0, '', 'Muntasir Billah Munna', 0, 0),
(18, 'ArnoldC', NULL, 1000, 524288, 'Standard Input', 'Standard Output', '<p style="margin-bottom: 0in;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">Programmers always like to learn new Programming languages. If you are reading this sentences that means you are a programmer too. Lets learn a new programming language today. </span></span></span></p>\r\n<p style="margin-bottom: 0in;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">ArnoldC is an imperative programming language where the basic keywords are replaced with quotes from different Schwarzenegger movies. Parsing is done with Parboiled and ASM is used to generate the Java bytecode.</span></span></span></p>\r\n<p style="margin-bottom: 0in;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">In the following table you are given some ArnoldC syntax and equivalent C sytnax. </span></span></span></p>\r\n<p style="margin-bottom: 0in;" align="justify">&nbsp;</p>\r\n<table width="643" cellspacing="0" cellpadding="4">\r\n<tbody>\r\n<tr valign="top">\r\n<td style="border-top: 1px solid #000000; border-bottom: 1px solid #000000; border-left: 1px solid #000000; border-right: none; padding: 0.04in 0in 0.04in 0.04in;" width="93">\r\n<p style="margin-top: 0.17in; page-break-after: avoid;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;"><strong>Task Name</strong></span></span></span></p>\r\n</td>\r\n<td style="border-top: 1px solid #000000; border-bottom: 1px solid #000000; border-left: 1px solid #000000; border-right: none; padding: 0.04in 0in 0.04in 0.04in;" width="328">\r\n<p style="margin-top: 0.17in; page-break-after: avoid;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;"><strong>ArnoldC Syntax</strong></span></span></span></p>\r\n</td>\r\n<td style="border: 1px solid #000000; padding: 0.04in;" width="196">\r\n<p style="margin-top: 0.17in; page-break-after: avoid;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;"><strong>C Syntax</strong></span></span></span></p>\r\n</td>\r\n</tr>\r\n<tr valign="top">\r\n<td style="border-top: none; border-bottom: 1px solid #000000; border-left: 1px solid #000000; border-right: none; padding: 0in 0in 0.04in 0.04in;" width="93">\r\n<p align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">BeginMain</span></span></span></p>\r\n</td>\r\n<td style="border-top: none; border-bottom: 1px solid #000000; border-left: 1px solid #000000; border-right: none; padding: 0in 0in 0.04in 0.04in;" width="328">\r\n<p align="justify"><code><span style="color: #000000;"><span style="font-family: Monaco,monospace;"><span style="font-size: small;">IT''S SHOWTIME</span></span></span></code></p>\r\n</td>\r\n<td style="border-top: none; border-bottom: 1px solid #000000; border-left: 1px solid #000000; border-right: 1px solid #000000; padding: 0in 0.04in 0.04in 0.04in;" width="196">\r\n<p align="justify"><span style="color: #000000;"><span style="font-family: Monaco,monospace;"><span style="font-size: small;">int main(){</span></span></span></p>\r\n</td>\r\n</tr>\r\n<tr valign="top">\r\n<td style="border-top: none; border-bottom: 1px solid #000000; border-left: 1px solid #000000; border-right: none; padding: 0in 0in 0.04in 0.04in;" width="93">\r\n<p align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">EndMain</span></span></span></p>\r\n</td>\r\n<td style="border-top: none; border-bottom: 1px solid #000000; border-left: 1px solid #000000; border-right: none; padding: 0in 0in 0.04in 0.04in;" width="328">\r\n<p align="justify"><code><span style="color: #000000;"><span style="font-family: Monaco,monospace;"><span style="font-size: small;">YOU HAVE BEEN TERMINATED</span></span></span></code></p>\r\n</td>\r\n<td style="border-top: none; border-bottom: 1px solid #000000; border-left: 1px solid #000000; border-right: 1px solid #000000; padding: 0in 0.04in 0.04in 0.04in;" width="196">\r\n<p align="justify"><span style="color: #000000;"><span style="font-family: Monaco,monospace;"><span style="font-size: small;">}</span></span></span></p>\r\n</td>\r\n</tr>\r\n<tr valign="top">\r\n<td style="border-top: none; border-bottom: 1px solid #000000; border-left: 1px solid #000000; border-right: none; padding: 0in 0in 0.04in 0.04in;" width="93">\r\n<p align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">Return</span></span></span></p>\r\n</td>\r\n<td style="border-top: none; border-bottom: 1px solid #000000; border-left: 1px solid #000000; border-right: none; padding: 0in 0in 0.04in 0.04in;" width="328">\r\n<p align="justify"><code><span style="color: #000000;"><span style="font-family: Monaco,monospace;"><span style="font-size: small;">I''LL BE BACK</span></span></span></code></p>\r\n</td>\r\n<td style="border-top: none; border-bottom: 1px solid #000000; border-left: 1px solid #000000; border-right: 1px solid #000000; padding: 0in 0.04in 0.04in 0.04in;" width="196">\r\n<p align="justify"><span style="color: #000000;"><span style="font-family: Monaco,monospace;"><span style="font-size: small;">return 0;</span></span></span></p>\r\n</td>\r\n</tr>\r\n<tr valign="top">\r\n<td style="border-top: none; border-bottom: 1px solid #000000; border-left: 1px solid #000000; border-right: none; padding: 0in 0in 0.04in 0.04in;" width="93">\r\n<p align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">Print</span></span></span></p>\r\n</td>\r\n<td style="border-top: none; border-bottom: 1px solid #000000; border-left: 1px solid #000000; border-right: none; padding: 0in 0in 0.04in 0.04in;" width="328">\r\n<p align="justify"><code><span style="color: #000000;"><span style="font-family: Monaco,monospace;"><span style="font-size: small;">TALK TO THE HAND "</span></span></span></code><code><span style="color: #000000;"><span style="font-family: Monaco,monospace;"><span style="font-size: small;">X"</span></span></span></code></p>\r\n</td>\r\n<td style="border-top: none; border-bottom: 1px solid #000000; border-left: 1px solid #000000; border-right: 1px solid #000000; padding: 0in 0.04in 0.04in 0.04in;" width="196">\r\n<p align="justify"><span style="color: #000000;"><span style="font-family: Monaco,monospace;"><span style="font-size: small;">printf("X") </span></span></span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style="margin-bottom: 0in;" align="justify">&nbsp;</p>\r\n<p style="margin-bottom: 0in;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">Lets just think you already know C programming lanuguage. Now you have learned few syntax of ArnoldC language. You need to convert your C code into ArnoldC code. </span></span></span></p>', '<p style="margin-bottom: 0in;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">First line of input contain a single integer <strong>T (1&lt;</strong><strong>=</strong><strong>T&lt;</strong><strong>=</strong><strong>5)</strong>, denotes the test cases. For each test case you will be given <strong>4</strong> line of C code which contain only <strong>4</strong> tasks BeginMain, Return, EndMain, Print. Length of line is atmost <strong>50</strong> character. </span></span></span></p>', '<p style="margin-bottom: 0in; font-weight: normal;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">For each test case print the equivalent ArnoldC code and a blank line. </span></span></span></p>', '1\r\nint main(){\r\n    printf("IST");\r\n    return 0;\r\n}\r\n', 'IT''S SHOWTIME \r\nTALK TO THE HAND "IST" \r\nI''LL BE BACK \r\nYOU HAVE BEEN TERMINATED\r\n', NULL, '2015-12-30 11:48:37', '3\r\nint main(){\r\n    printf("IST");\r\n    return 0;\r\n}\r\nint main(){\r\n    printf("pcIST Contest");\r\n    return 0;\r\n}\r\nint main(){\r\nprintf("Beautiful Bangladesh");\r\nreturn 0;\r\n}\r\n', 'IT''S SHOWTIME\r\nTALK TO THE HAND "IST"\r\nI''LL BE BACK\r\nYOU HAVE BEEN TERMINATED\r\n\r\nIT''S SHOWTIME\r\nTALK TO THE HAND "pcIST Contest"\r\nI''LL BE BACK\r\nYOU HAVE BEEN TERMINATED\r\n\r\nIT''S SHOWTIME\r\nTALK TO THE HAND "Beautiful Bangladesh"\r\nI''LL BE BACK\r\nYOU HAVE BEEN TERMINATED\r\n', 0, '', 'Md. Al-Amin Opu', 0, 0),
(19, 'Century', NULL, 1000, 524288, 'Standard Input', 'Standard Output', '<p style="margin-bottom: 0in;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;"><span style="font-weight: normal;">In the </span><span style="text-decoration: none;">sport</span><span style="font-weight: normal;"> of </span>cricket<span style="font-weight: normal;">, a </span><strong>century</strong><span style="font-weight: normal;"> is a score of 100 or more </span>runs<span style="font-weight: normal;"> in a single </span><span style="text-decoration: none;">innings</span><span style="font-weight: normal;"> by a </span>batsman<span style="font-weight: normal;">. The term is also included in "century partnership" which occurs when two batsmen add 100 runs to the team total when they are batting together. A century is regarded as a landmark score for batsmen and a player''s number of centuries is generally recorded in his career statistics. Scoring a century is loosely equivalent in merit to a bowler taking five wickets in an innings, and is colloquially referred to as a </span><strong>ton</strong><span style="font-weight: normal;"> or </span><strong>hundred. </strong></span></span></span></p>\r\n<p style="margin-bottom: 0in; font-weight: normal;" align="justify">&nbsp;</p>\r\n<p style="margin-bottom: 0in;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;"><span style="font-weight: normal;">Probability that a batsman scores a century in a cricket match is </span><strong>2/</strong><strong>S</strong><span style="font-weight: normal;">. What is the probability that out of </span><strong>N</strong><span style="font-weight: normal;"> matches, he may score century in </span>exactly <strong>2</strong> matches. </span></span></span></p>', '<p style="margin-bottom: 0in;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">Input starts with an integer <strong>T (1&lt;=T&lt;=20)</strong> , denotes the test case. Each line of the test case contain two integet <strong>S (3&lt;=S&lt;=10)</strong> and <strong>N (2&lt;=N&lt;=20).</strong></span></span></span></p>', '<p style="margin-bottom: 0in; font-weight: normal;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">For each line of input print the output in the following format "Case #x: y", where x is the case number and y is the probability that out of N matches a batsman may score century in exactly 2 matches. </span></span></span></p>', '2\r\n3 5\r\n4 7', 'Case 1: 0.164609\r\nCase 2: 0.164062', NULL, '2015-12-30 11:50:20', '20\r\n3 5\r\n4 7\r\n3 4\r\n3 6\r\n3 7\r\n3 8\r\n5 4\r\n5 2\r\n10 20\r\n10 19\r\n9 18\r\n9 7\r\n9 8\r\n8 8\r\n4 4\r\n5 5\r\n4 2\r\n6 3\r\n7 6\r\n8 7\r\n', 'Case 1: 0.164609\r\nCase 2: 0.164062\r\nCase 3: 0.296296\r\nCase 4: 0.082305\r\nCase 5: 0.038409\r\nCase 6: 0.017071\r\nCase 7: 0.345600\r\nCase 8: 0.160000\r\nCase 9: 0.136909\r\nCase 10: 0.154023\r\nCase 11: 0.135505\r\nCase 12: 0.295170\r\nCase 13: 0.306102\r\nCase 14: 0.311462\r\nCase 15: 0.375000\r\nCase 16: 0.345600\r\nCase 17: 0.250000\r\nCase 18: 0.222222\r\nCase 19: 0.318745\r\nCase 20: 0.311462\r\n', 0, '', 'Md. Al-Amin Opu', 0, 0);
INSERT INTO `problem` (`problem_id`, `problem_name`, `problem_level`, `problem_time_limit`, `problem_memory_limit`, `problem_input_channel`, `problem_output_channel`, `problem_description`, `problem_input`, `problem_output`, `problem_sample_input`, `problem_sample_output`, `problem_image`, `problem_add_date`, `problem_judge_input`, `problem_judge_output`, `problem_io_type`, `problem_hint`, `problem_setter`, `problem_status`, `problem_special_judge`) VALUES
(20, 'Find the Word', NULL, 1000, 524288, 'Standard Input', 'Standard Output', '<p style="margin-bottom: 0in; font-variant: normal; font-style: normal; text-decoration: none;" align="center">&nbsp;</p>\r\n<p style="margin-bottom: 0in;" align="center"><span style="color: #000000;"><img src="data:image/png;base64," alt="" width="429" height="350" align="bottom" /> </span></p>\r\n<p style="margin-bottom: 0in;" align="justify">&nbsp;</p>\r\n<p style="margin-bottom: 0in;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">This word grid might be known to you. In a word grid, multiple word can be found horizontally or vertically. But in this specific grid, there exists only one word, which is very familiar to each of the contestants. Can you find it?</span></span></span></p>', '<p style="margin-bottom: 0in;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">Use the given word grid.</span></span></span></p>', '<p style="margin-bottom: 0in; font-weight: normal;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">Print the desired word.</span></span></span></p>', 'No Sample Input', 'No Sample Output', NULL, '2015-12-30 11:52:42', '', 'CONTEST\r\n', 0, '', 'Anisuzzaman Khan', 0, 0);
INSERT INTO `problem` (`problem_id`, `problem_name`, `problem_level`, `problem_time_limit`, `problem_memory_limit`, `problem_input_channel`, `problem_output_channel`, `problem_description`, `problem_input`, `problem_output`, `problem_sample_input`, `problem_sample_output`, `problem_image`, `problem_add_date`, `problem_judge_input`, `problem_judge_output`, `problem_io_type`, `problem_hint`, `problem_setter`, `problem_status`, `problem_special_judge`) VALUES
(21, 'Murad Takla', NULL, 100, 524288, 'Standard Input', 'Standard Output', '<p style="margin-bottom: 0in;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">Disgusting, just disgusting. You know what I mean? There is these people, who doesn''t know (or doesn''t want to know) how to write any phonetic world. Phonetic means the syntax of representing a word of one language in the letters of the alphabet of another language. For example, &ldquo;Amar shonar Bangla&rdquo; is actually a Bengali sentence, but it''s represented in the letters of English language. But these people, I mean the &ldquo;murad takla&rdquo; people, somehow they always manage to mix up the vowels when writing in phonetic. They write &ldquo;Eta ki?&rdquo; as &ldquo;Ata ke?&rdquo;, &ldquo;Ami jiboneo programming kori nai&rdquo; as &ldquo;Ame geboao pograming kare nae&rdquo; and so on. You can see that they also make too much spelling mistake, and mix up some consonants, too.</span></span></span></p>\r\n<p style="margin-bottom: 0in;" align="justify">&nbsp;</p>\r\n<p style="margin-bottom: 0in;" align="justify"><img style="display: block; margin-left: auto; margin-right: auto;" src="data:image/jpeg;base64," alt="" width="320" height="320" name="Image1" align="left" border="0" /> </p>\r\n<p style="margin-bottom: 0in;" align="justify">&nbsp;</p>\r\n<p style="margin-bottom: 0in;" align="justify">&nbsp;</p>\r\n<p style="margin-bottom: 0in;" align="justify">&nbsp;</p>\r\n<p style="margin-bottom: 0in;" align="justify">&nbsp;</p>\r\n<p style="margin-bottom: 0in;" align="justify">&nbsp;</p>\r\n<p style="margin-bottom: 0in;" align="justify">&nbsp;</p>\r\n<p style="margin-bottom: 0in;" align="justify">&nbsp;</p>\r\n<p style="margin-bottom: 0in;" align="justify">&nbsp;</p>\r\n<p style="margin-bottom: 0in;" align="justify">&nbsp;</p>\r\n<p style="margin-bottom: 0in;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">Now Bangladesh Army is trying to develop a robot which can find murad takla people and punch them in the face. To do that, the robot should be able to predict what should be the takla representation of a normal sentence. So they need your help.</span></span></span></p>\r\n<p style="margin-bottom: 0in;" align="justify">&nbsp;</p>\r\n<p style="margin-bottom: 0in;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">Yes you are the best programmer of Bangladesh, and now Bangladesh army needs the takla representation of some specific normal texts. Can you do that? Your task is simple, change every occurrence of <strong>e, i, u, j, y, b</strong> to <strong>a, e, o, g, i, v</strong> in any given string. You don''t have to worry about the spelling mistakes for now.</span></span></span></p>', '<p style="margin-bottom: 0in;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">The first line of input is an integer, <strong>T (</strong><strong>1&lt;=T&lt;=1</strong><strong>0</strong><strong>)</strong> denoting the number of test cases.</span></span></span></p>\r\n<p style="margin-bottom: 0in;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">The following <strong>T</strong> lines will contain T strings (single string per line) of length<strong> L (</strong><strong>1&lt;=L&lt;=10</strong><sup><strong>3</strong></sup><strong>)</strong>. The string may or may not contain whitespaces, special characters, punctuation marks etc.</span></span></span></p>', '<p style="margin-bottom: 0in;" align="justify"><span style="color: #000000;"><span style="font-family: Times,serif;"><span style="font-size: medium;">Output a single line for each line of input, changing the characters into takla language.</span></span></span></p>', '4\r\nEta ki?\r\nAmi jiboneo programming kori nai\r\nBondhura, tomra kemon acho?\r\nSokale uthe shit er pitha khete issa kortese', 'Ata ke?\r\nAme gevonao programmeng kore nae\r\nVondhora, tomra kamon acho?\r\nSokala otha shet ar petha khata essa kortasa', NULL, '2015-12-30 11:55:26', '10\r\\r\\r\\r\\r\\r\\r\\r\\r\\r\\r\n', '\r\\r\\r\\r\\r\\r\\r\\r\\r\\r\n', 0, '', 'Muntasir Billah Munna', 0, 0);

